import React, {Component} from 'react'
import logo from '../pictures/arcade-logo.jpg'

class Navbar extends Component {
    render () {
        return(
            <nav bg = 'light' className='navbar fixed-top shadow p-0' style={{
                backgroundColor:'black',
                height:'50px'
            }}>
                <a className='navar-brand col-sm-3 cl-md-2 mr-0' style={{color:'white'}}>
                <img src ={logo} width='50' height='40' className='d-inline-block align-top' alt='bank-logo'/>
                &nbsp;&nbsp;Hopeful Arcade</a>
                <ul className='navbar-nav px-3'>
                    <li>Coin Flipper</li>
                    <li className=' d-none nav-item d-sm-none d-sm-block'>
                        <small style= {{color:'white'}}>Account Number: {this.props.account}</small>
                    </li>
                </ul>
            </nav>
        )
    }
}

export default Navbar;
